import React from 'react'
import { Component } from 'react'
import './App.css'

function Home() {
    return (
        <div className='Home'>
            <h1>Home</h1>
            <JsonForm />
        </div>
    )
}

export default Home

class JsonForm extends Component{
    constructor(props){
        super(props)
        this.state={
            input1:'hello'
        }
    }

    handleChange(event){
        alert('jj')
    }

    render(){
        return(
            <div>
                <form>
                    <input type="text" value={this.state.input1} name='input1' onChange={this.handleChange}></input>
                    <input type="submit" value="Submit"></input>
                </form>
            </div>
        );
    }
}
